"""Images in dataset may have different resolutions.
Force resize during dataset preparation by passing each image through a Composable TorchVision pipeline that:

*   Converts data into an Image Type
*   Resizes the image to the target resolution
*   Converts data points to float32
*   Outputs Pure Tensor data


"""

# build resize pipeline
resize_preprocessor: Callable = TF.Compose([TF.ToImage(),
                                            TF.Resize(size=datasample_size, interpolation=TF.InterpolationMode.BICUBIC, antialias=True),
                                            TF.ToDtype(torch.float32, scale=True),
                                            TF.ToPureTensor()])

