# Generator CNN code
class ConvolutionalGenerator(NN.Module):
  # constructor
  def __init__(self: NN.Module):
    super().__init__()
    self.model = NN.Sequential(
        # First ConvTranspose Layer
        # Input: Z(latent_space)
        NN.ConvTranspose2d(latent_space_size, generator_feature_map_depth * 8, 4, 1, 0, bias=False),
        NN.BatchNorm2d(generator_feature_map_depth * 8),
        NN.ReLU(inplace=True),
        # Output is 1024 channels, 4x4 size (conv kernel size) --> (generator_feature_map_depth*8) x 4 x 4
        NN.ConvTranspose2d(generator_feature_map_depth * 8, generator_feature_map_depth * 4, 4, 2, 1, bias=False),
        NN.BatchNorm2d(generator_feature_map_depth * 4),
        NN.ReLU(inplace=True),
        # halve channel size, double channel dimensionality --> (generator_feature_map_depth*4) x 8 x 8
        NN.ConvTranspose2d(generator_feature_map_depth * 4, generator_feature_map_depth * 2, 4, 2, 1, bias=False),
        NN.BatchNorm2d(generator_feature_map_depth * 2),
        NN.ReLU(inplace=True),
        # halve channel size, double channel dimensionality --> (generator_feature_map_depth*2) x 16 x 16
        NN.ConvTranspose2d( generator_feature_map_depth * 2, generator_feature_map_depth, 4, 2, 1, bias=False),
        NN.BatchNorm2d(generator_feature_map_depth),
        NN.ReLU(True),
        # halve channel size, double channel dimensionality --> (generator_feature_map_depth) x 32 x 32
        NN.ConvTranspose2d(generator_feature_map_depth, channels, 4, 2, 1, bias=False),
        NN.Tanh()
        # Network Output --> image of the same dimensionality as dataset --> (channels) x 64 x 64
    )

  # forward computation
  def forward(self, input_data: torch.Tensor) -> torch.Tensor:
    return self.model(input_data)

# Detector CNN Code
class ConvolutionalDetector(NN.Module):
  def __init__(self: NN.Module):
    super().__init__()
    self.model = NN.Sequential(
        # Input: Dataset image or Generated Image -> channels x 64 x64
        NN.Conv2d(channels, detector_feature_map_depth, 4, 2, 1, bias=False),
        NN.LeakyReLU(0.02, inplace=True),
        # Output -> (discriminator_feature_depth_size) x 32 x 32
        NN.Conv2d(detector_feature_map_depth, detector_feature_map_depth*2, 4, 2, 1, bias=False),
        NN.BatchNorm2d(detector_feature_map_depth*2),
        NN.LeakyReLU(0.02, inplace=True),
        # Output -> (discriminator_feature_depth_size*2) x 16 x 16
        NN.Conv2d(detector_feature_map_depth*2, detector_feature_map_depth*4, 4, 2, 1, bias=False),
        NN.BatchNorm2d(detector_feature_map_depth*4),
        NN.LeakyReLU(0.02, inplace=True),
        # Output -> (discriminator_feature_depth_size*4) x 8 x 8
        NN.Conv2d(detector_feature_map_depth*4, detector_feature_map_depth*8, 4, 2, 1, bias=False),
        NN.BatchNorm2d(detector_feature_map_depth*8),
        NN.LeakyReLU(0.02, inplace=True),
        # Output -> (discriminator_feature_depth_size*8) x 1 x 1
        NN.Conv2d(detector_feature_map_depth*8, 1, 4, 1, 0, bias=False),
        NN.Sigmoid()
        # Output 1
    )

  # forward computation
  def forward(self, input_data: torch.Tensor) -> int:
    return self.model(input_data)

# model wrapper
class FaceGAN(object):
  def __init__(self, generator, detector, gen_optimizer, dect_optimizer):
    self.generator = generator
    self.generator_optimizer = gen_optimizer
    self.detector = detector
    self.detector_optimizer = dect_optimizer

  def print(self):
    print(self.generator)
    print(self.detector)

# determine processor type
